async function seedAll() {
  await mongoose.connect(process.env.MONGO_URI, {
    useNewUrlParser:    true,
    useUnifiedTopology: true,
  });

  //
  // ─── 1) UPSERT STOCKS ────────────────────────────────────────────────────────────
  //
  // For each stock in newStocks.json, do an updateOne({ ticker }, { $setOnInsert: { … } }, upsert:true)
  const stockOps = newStocks.map((s) => ({
    updateOne: {
      filter: { ticker: s.ticker },
      update: {
        $setOnInsert: {
          price:            s.price,
          change:           s.change,
          sector:           s.sector,
          eps:              s.eps,
          outstandingShares: s.outstandingShares,
          peRatio:          +(s.price / s.eps).toFixed(2),
          dividendYield:    +((s.eps * 0.4) / s.price).toFixed(4),
          history:          [s.price],
          volatility:       0.01,
          liquidity:        0,
          basePrice:        s.price
        }
      },
      upsert: true
    }
  }));

  let stockResult;
  try {
    stockResult = await Stock.bulkWrite(stockOps, { ordered: false });
    console.log(`✅ Stocks upserted: inserted=${stockResult.upsertedCount}, matched=${stockResult.matchedCount}`);
  } catch (err) {
    console.error('❌ Error during Stock bulkWrite:', err);
    // We’ll keep going to news; you can inspect which ones failed above.
  }

  //
  // ─── 2) UPSERT STOCK‐SPECIFIC NEWS ───────────────────────────────────────────────────
  //
  // For each entry in newStockNews.json, do:
  //   updateOne({ ticker }, { $setOnInsert: { ticker }, $push: { articles: { $each: […] } } }, upsert:true)
  const newsOps = newStockNews.map((entry) => ({
    updateOne: {
      filter: { ticker: entry.ticker },
      update: {
        // If this ticker doesn't exist in StockNews, create it with just { ticker } first:
        $setOnInsert: { ticker: entry.ticker },
        // Then push all new articles into its articles array:
        $push: {
          articles: {
            $each: entry.articles.map((a) => ({
              headline: a.headline,
              body:     a.body,
              date:     new Date(a.date)
            }))
          }
        }
      },
      upsert: true
    }
  }));

  let newsResult;
  try {
    newsResult = await StockNews.bulkWrite(newsOps, { ordered: false });
    console.log(
      `✅ StockNews upserted: inserted=${newsResult.upsertedCount}, matched=${newsResult.matchedCount}, modified=${newsResult.modifiedCount}`
    );
  } catch (err) {
    console.error('❌ Error during StockNews bulkWrite:', err);
  }

  //
  // ─── FINISH ─────────────────────────────────────────────────────────────────────────
  //
  await mongoose.disconnect();
  process.exit(0);
}

seedAll().catch((err) => {
  console.error('❌ Unexpected error in seedAll():', err);
  process.exit(1);
});







